import axios from 'axios';
import React, {useEffect, useState} from 'react';


const Patient_list = () =>{
    const baseurl = 'http://49.50.167.136:9871/'

    const [plist,setPlist] = useState([]);

    useEffect(()=>{
        axios.get(baseurl+'api/patient/list?page=1&order_desc=false')
        .then((res)=>{
            console.log(res.data.patient)
            setPlist(res.data.patient.list)
        }).catch((err)=>{
            console.log(err)
        })
    },[])
    console.log(plist)

    const patient_list = plist.map((li,index)=>
        <div key = {index}>
            {index === 0}
            <div>
                <p>{li.age}</p>
                <p>{li.birthDatetime}</p>
                <p>{li.ethnicity}</p>
                <p>{li.gender}</p>
                <p>{li.isDeath}</p>
                <p>{li.personID}</p>
                <p>{li.race}</p>
            </div>
        </div>
    )
    return(
        <div>
            <p>Patient_list</p>
            {patient_list}
        </div>
    )
}

export default Patient_list
